import React from 'react'

export const MatchDetailCard = ({ match }) => {
  if (!match) return null
  return (
    <div className="MatchDetailCard">
      <h3>Latest Matches</h3>
      <h4>Match Details</h4>
      <h4>
        {match.team1} vs {match.team2}
      </h4>
    </div>
  )
}
